import React from 'react'
import PizzaLeft from '../assets/pizzaLeft.jpg'

function Contact() {
    return (
        <div className='contact'>
             <div className= 'leftSide' style= {{ backgroundImage: `url(${pizzaLeft})` }}>
            </div>
            <div className='rightSide'></div>
        </div>
    )
}

export default Contact
